import React, { Component } from "react";
import { Switch, Route, BrowserRouter } from "react-router-dom";
import "./App.css";
import Home from "./Components/Home";

class App extends Component {
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <Switch>
            <Route component={Home} path="/" />
          </Switch>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
